  return (
    <div className="App">      
    <Header></Header>
      <Title>DADOS GERAIS</Title>
      <Wrapper>
        <FullInput title="Nome"/>
        <FullInput title="E-mail"/>
        <FullInput title="CPF"/>
        <FullInput title="Data de Nascimento"/>

      </Wrapper>
    </div>
  );
}
export default App;
